var cartsec=document.querySelector(".cart-sec")
console.log(cartsec)

function topcart(){
	cartsec.classList.add("cart-active");
}

function closebtn(){
	cartsec.classList.remove("cart-active");
}

document.addEventListener('DOMContentLoaded',loadFood);
function loadFood(){
	loadContent();
}

function loadContent(){
	//delete food items
	var deleteBtn=document.querySelectorAll("#cart-remove");
	deleteBtn.forEach((btn)=>{
		btn.addEventListener('click',deleteItem)
	})
	
	//quantity change food item
	var cartQuantity=document.querySelectorAll(".cart-quantity");
	cartQuantity.forEach((q)=>{
		q.addEventListener('change',changeQty)
	})
	
	//product cart
	var btnAdd=document.querySelectorAll(".cart-btn");
	btnAdd.forEach((btn)=>{
		btn.addEventListener('click',addItems)
	})
	
	total();
	
}


//delete item
function deleteItem(){
	if(confirm('Are You Sure to Remove')){
		let dish=document.querySelector('.cart-food-title').innerHTML;
		console.log(dish)
		itemList=itemList.filter(e=>e.title != dish);
	    this.parentElement.remove();
		loadContent();
	
	}
}


//quantity change
function changeQty(){
	if(isNaN(this.value) || (this.value<1)){
		this.value=1;
	}
}


let itemList=[];


//add items
function addItems(){
	console.log("add")
	let product=this.parentElement;
	let title=product.querySelector('.food-title').innerHTML;
	let price=product.querySelector('.food-price').innerHTML;;
	let img=product.querySelector('.food-img').src;
	// console.log(product)
	// console.log(title ,price ,img)


    let productList={title ,price ,img};
	
	//check product already in cart items
	if(itemList.find((el)=>el.title==productList.title)){
		alert("Product Already added in Cart Items");
		return;
	}
	else{
		itemList.push(productList);
	}


	
	let newProduct=creatItems(title,price,img);
	let newelement=document.createElement('div');
	newelement.innerHTML=newProduct;
	let cartBasket=document.querySelector('.cart-content');
	cartBasket.append(newelement);
	loadContent();
}

function creatItems(title,price,img){
	return`<div class="cart-box">
				   <img src=${img} class="cart-img">
				   <div class="detail-box">
						<div class="cart-food-title">${title}</div>
						<div class="price-box"> 
						   <div class="cart-price">${price}</div>
						   <div class="cart-amt">$ ${price}</div>
						</div>
						<input type="number" value="1" class="cart-quantity">
				   </div>
				   <i class="bi bi-trash3-fill" id="cart-remove"></i>
				</div>`
}

//update total
function total(){
	const boxItem=document.querySelectorAll('.cart-box');
	const totalValue=document.querySelector('.total-price');

	let totalPrice=0;
	
	boxItem.forEach(product=>{
	
		let priceElement=product.querySelector('.cart-price').innerHTML;
		console.log(priceElement)
		
		// let price=priceElement.slice(3,7);
		// console.log(parseInt(price+1))
		
		let price=parseFloat(priceElement.replace("Rs.",""));
		console.log(price)
		
		let qty=product.querySelector('.cart-quantity').value;
		console.log(qty);

		totalPrice+=(price*qty);
		let amt=product.querySelector('.cart-amt')
		amt.innerText="Rs."+price*qty;
		
	
	});
	totalValue.innerHTML="Rs."+totalPrice;
	
}





function item(a){
	a.forEach(function(e){
	 console.log(e);
		
// -----col----
	var div=document.createElement("div");
	div.classList.add("col");
	cards.appendChild(div);

// -----col-card----
	var div2=document.createElement("div");
	div2.classList.add("col-card");
	div.appendChild(div2);
	
	var img=document.createElement("img");
	img.classList.add("food-img");
	img.src=e.imgUrl;
	div2.appendChild(img);
	
	var head=document.createElement("h2");
	head.classList.add("food-title");
	head.innerHTML=e.name;
	div2.appendChild(head);
	
	var para=document.createElement("p");
	para.innerHTML=e.cuisine;
	div2.appendChild(para);
	
	var innerDiv=document.createElement("div");
	innerDiv.classList.add("inner-row");
	div2.appendChild(innerDiv);
	
	var iconDiv=document.createElement("div");
	iconDiv.classList.add("icon-div");
	innerDiv.appendChild(iconDiv);
	
	var icon=document.createElement("i");
	icon.classList.add("bi");
	icon.classList.add("bi-star-fill");
	iconDiv.appendChild(icon);
	
	var rTag=document.createElement("p");
    rTag.innerHTML=e.ratings;
	iconDiv.appendChild(rTag);
	
	var amountDiv=document.createElement("div");
    amountDiv.classList.add("amount-div")
	innerDiv.appendChild(amountDiv);
	
	var amTag=document.createElement("p");
	amTag.classList.add("food-price");
    amTag.innerHTML=e.amount;
	amountDiv.appendChild(amTag);
	
	var pre=document.createElement("p");
    pre.innerHTML=e.preparation+"mins";
	amountDiv.appendChild(pre);
	
	var units=document.createElement("p");
    units.innerHTML=e.units;
	amountDiv.appendChild(units);
   
    
	var cartbtn=document.createElement("button");
    cartbtn.classList.add("bi");
    cartbtn.classList.add("bi-cart-dash");
	cartbtn.classList.add("cart-btn");
    cartbtn.style.backgroundColor="#c475e5";
    cartbtn.style.border="none";
    cartbtn.style.padding="5px";
    cartbtn.style.fontSize="20px";
    cartbtn.style.color="white";
    div2.appendChild(cartbtn);
	
	
	//------- rating order------
	rating()
	function rating(){
		if(e.ratings >=4.0){
			iconDiv.classList.add("icon-div-green");
		}
		else if(e.ratings >=2.5 && e.ratings <= 3.9){
			iconDiv.classList.add("icon-div-orange");
			
		} 
		else if(e.ratings <= 2.4){
			iconDiv.classList.add("icon-div-red");
		}
	}

	});
}


