function defaultSorter(){
	var colsRemove=document.querySelectorAll(".col");
	colsRemove.forEach(function(e){
		e.remove()
	})
	item(food)
}



// -----rating----
function ratingSorter(){
	var sortRatingObj=food.sort(function(a,b){
		return b.ratings-a.ratings
	})
	console.log(sortRatingObj);
	
	var colsRemove=document.querySelectorAll(".col")
     colsRemove.forEach(function(e){
		e.remove()
	})
	item(sortRatingObj)
	
}

